  const [nav, setNav] = useState(false);

  return (
    <>
      <Nav />
      {/* Outlet을 감싸는 상위 컴포넌트에서 setNav props를 설정하고 Body 컴포넌트로 전달 */}
      <Outlet setNav={setNav} />
      {/* <Footer /> */}
    </>
  );
}

export default App;
